    p1 = line_segment_circle(x2 - x1, y2 - y1, cx - x1, cy - y1, r, True)
    p2 = line_segment_circle(x3 - x2, y3 - y2, cx - x2, cy - y2, r, True)
    p3 = line_segment_circle(x1 - x3, y1 - y3, cx - x3, cy - y3, r, True)
